import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the cart icon (using class selector, should open cart modal)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear (look for .cart-item or .empty-cart)
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Take screenshot of empty cart or cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // If cart is empty, add a product to cart first
    let cartIsEmpty = false;
    if (await page.$('.empty-cart')) {
      cartIsEmpty = true;
      // Close cart modal
      const closeBtn = await page.$('#cartModal button.close, #cartModal .close, #cartModal [aria-label="Close"]');
      if (closeBtn) await closeBtn.click();
      else await page.keyboard.press('Escape');

      // Wait for modal to close
      await page.waitForSelector('#cartModal', { state: 'hidden', timeout: 5000 });

      // Add first product to cart (find first .add-to-cart button)
      await page.waitForSelector('.add-to-cart', { timeout: 5000 });
      const addToCartBtn = (await page.$$('.add-to-cart'))[0];
      await addToCartBtn.click();

      // Wait for notification to disappear (if any)
      await page.waitForTimeout(1000);

      // Open cart again
      await page.click('.cart');
      await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });
      await page.waitForSelector('.cart-item', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_with_item.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_cart_with_item.png'));
    }

    // Find the first cart item and its quantity
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    const cartItem = (await page.$$('.cart-item'))[0];

    // Extract current quantity
    const quantitySpan = await cartItem.$('.quantity');
    let oldQuantity = await quantitySpan.textContent();
    oldQuantity = parseInt(oldQuantity);

    // Click the "+" button to increase quantity
    const plusBtn = await cartItem.$('.quantity-btn:nth-of-type(2)');
    await plusBtn.click();

    // Wait for quantity to update
    await page.waitForFunction(
      (el, prev) => parseInt(el.textContent) === prev + 1,
      quantitySpan,
      oldQuantity,
      { timeout: 5000 }
    );

    // Take screenshot after increasing quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_increased.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_increased.png'));

    // Extract updated quantity and cart total
    const newQuantity = parseInt(await quantitySpan.textContent());
    const cartTotal = await page.$eval('#cartTotal', el => el.textContent);

    // Return result
    return {
      success: true,
      action: "Updated cart item quantity by increasing it using the '+' button in the cart modal.",
      extractedData: {
        oldQuantity,
        newQuantity,
        cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
